I Must Be Consistent...
I Must Be Consistent...

As small business owners we should use it as a mantra, or go old school and write lines a thousand times to remind ourselves and imprint it in our heads. 🧠

It's the ONE THING that will make the biggest difference. 
You can apply it to everything you can to succeed at!
I'm back with my PT.... once a week to start with and building up slowly. I've lost a stone since we've been back from holiday and it is not easy!💪

I am hungry a lot! It's not lock down over eating, I guess it's 10 years of very happy marriage and an love of all things food and wine. 🥞🍷

My knees hurt so we're working on making me stronger. I'm back at daily yoga and it's all progress - baby steps. 

I've known the lovely Chris my PT for 15+ years - I introduced him to his partner and they now have 2 gorgeous children - yes I have 2 weddings and 4 kids as a result of my fixing! 

It's in my blood!!

Anyway he says - "You know LDC it's all about your consistency!" If I'd had the energy I could have hit him.....but instead I just glared at him from my sweaty mess in the floor!

OMG! If I hear that one more time..... it should either be branded on my a*** or written on my grave....⚰️

They say kids, animals and businesses need routine and consistency - well so does exercise!🏋️‍♀️

So as we learn how to manage the ebb and flow of our businesses, our moods, our attention spans and our new normal what are you willing to commit to doing consistently?

Most people say it's showing up - but what does that mean to you? Showing up for your business? Or showing up for YOU? 
I'll start....
10,000 steps a day
Healthy eating
Consistent daily posting
1 FB live a week
1 email a week to my list
What about you? 👇👇👇

Hugs 💙 LDC xox

